// SPDX-License-Identifier:MIT
pragma solidity 0.8.13;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";

contract GameV2 is ERC1155{
    uint256 public currentTokenCount;
    uint256 public currentClientCount;
    mapping (address => uint256[]) public TokenIDowned;
    mapping (string=>uint256) public NameToTokenID;
    address [] public Client;
    address _owner;


    constructor() ERC1155(""){
        currentClientCount = 0;
        currentTokenCount = 0;
        _owner = msg.sender;
    }

    function registerAsClient (uint256 _id) public payable {
        //require(msg.value > 1, "Insufficient Amount!");
        Client.push(msg.sender);
        currentClientCount = currentClientCount + 1;
        _setApprovalForAll(msg.sender, _owner, true);
    }

    function mintClass (address owner,uint256 _amount, string memory _name) public payable returns (uint256){
        //require(msg.value > 1, "Insufficient Amount!");
        _mint(owner, currentTokenCount, _amount, "");
        TokenIDowned[msg.sender].push(currentTokenCount);
        currentTokenCount = currentTokenCount + 1;
        NameToTokenID[_name] = currentTokenCount - 1;
        return currentTokenCount - 1;
    }

    function tranferToken(address to, string memory name, uint256 amount) public payable{
        require(balanceOf(msg.sender, NameToTokenID[name]) >= amount, "Not enough balance");
        _safeTransferFrom(msg.sender, to, NameToTokenID[name], amount, "");
    }

    function getCurrentTokenCount() public view returns(uint256){
        return currentClientCount;
    }

    function getCurrentClientCount() public view returns(uint256){
        return currentTokenCount;
    }
}
